    <style>
      :root {
        --purp1: hsl(292, 97%, 86%);

        --purp3: hsl(292, 95%, 62%);

        --dark2: hsl(0, 0%, 19%);
        --dark3: hsl(0, 0%, 13%);
        --dark4: hsl(0, 0%, 9%);
      }
      #sfx {
        position: fixed;
        display: none;
        z-index: -600;
      }
      #res {
        position: absolute;
        display: inline-block;
        font-family: Arial, Helvetica, sans-serif;
        position: fixed;
        top: 75%;
        left: 50%;
        text-align: center;
        transform: translate(-50%, -50%);
        font-size: 2.75cqw;
        touch-action: manipulation;
      }
      .kb {
        font-weight: bold;
        touch-action: manipulation;
      }
      #Cdown-par {
        position: absolute;
        top: 50%;
        left: 50%;
        width: 46.9%;
        height: 46.9%;
        background: none;
        border: none;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #Cdown {
        position: absolute;
        width: 60%;
        font-size: 12cqw;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #CDimg {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        position: absolute;
        margin: 0px;
        padding: 0px;
        top: 50%;
        left: 50%;
        height: 1em;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }
      #Pscore img {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        touch-action: manipulation;
      }
      #pause {
        position: absolute;
        width: 60%;
        top: 33%;
        left: 50%;
        font-size: 6cqw;
        font-family: Arial, Helvetica, sans-serif;
        text-align: center;
        transform: translate(-50%, -50%);
        font-weight: bold;
        color: hsl(272, 100%, 60%);
        -webkit-text-stroke-width: 0.33cqw;
        -webkit-text-stroke-color: hsl(272, 80%, 50%);
        touch-action: manipulation;
      }
      #Pscore {
        position: absolute;
        width: 60%;
        top: 50%;
        left: 50%;
        font-size: 6cqw;
        font-family: Arial, Helvetica, sans-serif;
        text-align: center;
        transform: translate(-50%, -50%);
        font-weight: bold;
        color: hsl(222, 100%, 50%);
        -webkit-text-stroke-width: 0.33cqw;
        -webkit-text-stroke-color: hsl(222, 100%, 40%);
        touch-action: manipulation;
      }
      #rel {
        position: relative;
        display: inline-block;
        width: 100%;
        height: 100%;
        touch-action: manipulation;
      }
      #blur {
        position: absolute;

        left: 50%;

        touch-action: manipulation;

        font-size: 40px;
        padding: 0px;

        background-color: transparent;
        touch-action: manipulation;

        background-repeat: no-repeat;
        background-position: center;
        width: 69.23%;
        height: 69.23%;
        touch-action: manipulation;
      }
      #up span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(0deg);
        touch-action: manipulation;
      }
      #down span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(180deg);
        touch-action: manipulation;

      #left span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(270deg);
        touch-action: manipulation;

      #right span {
        position: fixed;
        display: inline-block;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%) rotate(90deg);
        touch-action: manipulation;
      }
      body {
        background-color: #000;

        height: 89.2%;

        left: 50%;
        transform: translate(-50%, -50%);
        transition-property: width, height;
        transition-timing-function: ease-in-out;
        touch-action: manipulation;
      }
      #gc {

        top: 50%;
        left: 50%;
        width: 46.9%;
        height: 46.9%;
        transform: translate(-50%, -50%);
        touch-action: manipulation;

      #right {
        position: fixed;
        top: 50%;
        right: 50%;
        transform: translate(423.1%, -50%);
        touch-action: manipulation;
      }
      #left {
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-423.1%, -50%);
        touch-action: manipulation;
      }
      #up {
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -423.1%);
        touch-action: manipulation;
      }
      #down {
        position: fixed;
        bottom: 50%;
        left: 50%;
        transform: translate(-50%, 423.1%);
        touch-action: manipulation;
      }
      #game {
        display: none;
        width: 100%;
        height: 100%;
        touch-action: manipulation;
      }
      #title {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        transition-property: transform, top, width;
        transition-duration: 1s;
        transition-timing-function: ease-in-out;
        touch-action: manipulation;
      }
      #play {
        display: none;
        position: absolute;
        top: 60%;
        left: 50%;
        transform: translate(-50%, -50%);
        padding: none;
        width: 30%;
        border: none;
        background: none;
        touch-action: manipulation;
      }
      #playArea {
        display: none;
        position: absolute;
        top: 60%;
        left: 50%;
        transform: translate(-50%, -50%);
        padding: none;
        height: 16.25%;
        width: 32.5%;
        border: none;
        background: none;
        touch-action: manipulation;
      }
      #playBG {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        border: none;
        position: absolute;
        top: 50%;
        left: 50%;
        width: 100%;
        transform: translate(-50%, -50%);
        opacity: 0;
        transition-property: opacity;
        transition-duration: 1s;
        touch-action: manipulation;
      }
      #title {
        border-radius: 10px;
      }
      #playFG {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        border: none;
        position: absolute;
        top: 50%;
        left: 50%;
        width: 100%;
        transform: translate(-50%, -50%);
        opacity: 0;
        transition-property: opacity;
        transition-duration: 1s;
        touch-action: manipulation;
      }
      #trans {
        image-rendering: optimizeSpeed;
        image-rendering: -moz-crisp-edges;
        image-rendering: -o-crisp-edges;
        image-rendering: -webkit-optimize-contrast;
        image-rendering: pixelated;
        image-rendering: optimize-contrast;
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        width: 100%;
        border: none;
        touch-action: manipulation;
      }
      #comfort {
        display: inline-block;
        background-color: black;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        touch-action: manipulation;
      }

      function circle(x, y, rad, s) {
        ctx.beginPath();
        ctx.arc(x, y, rad, 0, Math.PI * 2);
        if(s) {
          ctx.strokeStyle = "black";
          ctx.lineWidth = s;
          ctx.stroke();
        }
        ctx.fill();
      }
      function semiCirc(x, y, rad, direct, sThick, sType) {
        let ln = {};
        let arc = {
          "u": {
            "sa": Math.PI,
            "ea": 2 * Math.PI
          },
          "d": {
            "sa": 0,
            "ea": Math.PI
          },
          "l": {
            "sa": 0.5 * Math.PI,
            "ea": 1.5 * Math.PI
          },
          "r": {
            "sa": 1.5 * Math.PI,
            "ea": 0.5 * Math.PI
          }
        }
        ctx.beginPath();
        
        ctx.arc(x, y, rad, arc[direct].sa, arc[direct].ea);
        ln = getArc((x, y, rad, arc[direct].sa, arc[direct].ea));
        
        if(sThick) {
          ctx.strokeStyle = "black";
          ctx.lineWidth = sThick;
          ctx.stroke();
        }
        ctx.fill();
      }
      function rect(x, y, width, height, stroke, sides) {
        if(stroke) {
          ctx.strokeStyle = "black";
          ctx.lineWidth = stroke;
          ctx.beginPath();
          if (sides && (sides.includes("u") || sides.includes("d") || sides.includes("l") || sides.includes("r"))) {
            if(sides.includes("u")) {
              ctx.moveTo(x, y);
              ctx.lineTo(x + width, y);
            }
            if(sides.includes("d")) {
              ctx.moveTo(x, y + height);
              ctx.lineTo(x + width, y + height);
            }
            if(sides.includes("l")) {
              ctx.moveTo(x, y);
              ctx.lineTo(x, y + height);
            }
            if(sides.includes("r")) {
              ctx.moveTo(x + width, y);
              ctx.lineTo(x + width, y + height);
            }
          } else {
            ctx.moveTo(x, y)
            ctx.lineTo(x, y + height);
            ctx.lineTo(x + width, y + height);
            ctx.lineTo(x + width, y);
            ctx.lineTo(x, y);
          }
          ctx.stroke();
        }
        ctx.fillRect(x, y, width, height);
      }
      function eyes(pupil) {
        let head = trail[trail.length - 1];
        let pupRad = 4;
        ctx.fillStyle = "White";
        circle((head.x * 20) + 10, (head.y * 20) + 10, 7, 2);
        ctx.fillStyle = "Black";
        if(pupil) {
          if(pupil === "shrink") {
            pupRad = 2;
          }
          if(!isNaN(pupil)) {
            pupRad = pupil;
          }
          if(Array.isArray(pupil) && pupil[0].toLowerCase() === "dead" && !isNaN(pupil[1])) {
            let cx = (head.x + 0.5) * 20;
            cx += xv;
            let cy = (head.y + 0.5) * 20;
            cy += yv;
            let rad = pupil[1] / Math.sqrt(2);
            let prevAlph = ctx.globalAlpha;

            let c1x = cx - rad;
            let c1y = cy - rad;

            let c2x = cx + rad;
            let c2y = cy + rad;

            let c3x = cx + rad;
            let c3y = cy - rad;

            let c4x = cx - rad;
            let c4y = cy + rad;

            ctx.beginPath();

            ctx.moveTo(c1x, c1y);
            ctx.lineTo(c2x, c2y);

            ctx.moveTo(c3x, c3y);
            ctx.lineTo(c4x, c4y);

            ctx.lineWidth = 2;
            ctx.globalAlpha = 0.25 * pupil[1];
            ctx.stroke();
            
            ctx.globalAlpha = 1 - ctx.globalAlpha;
            circle(cx, cy, 2);

            ctx.globalAlpha = prevAlph;
            
            return;
          }
        }
        if(xv == 1) {
          circle((head.x * 20) + 12.5, (head.y * 20) + 10, pupRad);
        } else if(xv == -1) {
          circle((head.x * 20) + 7.5, (head.y * 20) + 10, pupRad);
        } else if(yv == 1) {
          circle((head.x * 20) + 10, (head.y * 20) + 12.5, pupRad);
        } else if(yv == -1) {
          circle((head.x * 20) + 10, (head.y * 20) + 7.5, pupRad);
        } else {
          circle((head.x * 20) + 10, (head.y * 20) + 10, pupRad);
        }
      }
      function showHead() {
        let head = trail[trail.length - 1];
        let x1 = head.x * 20;
        let y1 = head.y * 20;
        let x2 = x1 + 10;
        let y2 = y1 + 10;
        let gs2 = gs / 2;
        let rad = 10;
        let sides = {
          "u": ["0", "0", "l", "r"],
          "d": ["0", "0", "l", "r"],
          "l": ["u", "d", "0", "0"],
          "r": ["u", "d", "0", "0"]
        }
        ctx.fillStyle = arrToCol(color[1]);
        if(pyv == -1) { // up
          rect(x1, y2, gs, gs2, outline, sides.u);
          semiCirc(x2, y2, rad, "u", outline);
        }
        if(pyv == 1) { // down
          rect(x1, y1, gs, gs2, outline, sides.d);
          semiCirc(x2, y2, rad, "d", outline);
        }
        if(pxv == -1) { // left
          rect(x2, y1, gs2, gs, outline, sides.l);
          semiCirc(x2, y2, rad, "l", outline);
        }
        if(pxv == 1) { // right
          rect(x1, y1, gs2, gs, outline, sides.r);

        }
      }
      function showTail() {
        let id = 0;
        let tile = trail[id];
        let sha = color[(trail.length - id) % 2];
        let grad = colToArr(snakeColor(id));
        let col = blendCol(grad, sha, 50);

        let rad = size.times(10);

        ctx.fillStyle = col;
        if(tyv == -1) { // up
          semiCirc(x2, y2, flo(rad), "d", outline);
          rect(x1 + flo(shr), y1, gs - flo(shr.times(2)), gs2, outline, ["l", "r"]);
        }
        if(tyv == 1) { // down

          rect(x1 + flo(shr), y1 + flo(shr.plus(9)), gs - flo(shr.times(2)), gs2, outline, ["l", "r"]);
        }
        if(txv == -1) { // left
          semiCirc(x2 - flo(shr), y2, flo(rad), "r", outline);
          rect(x1, y1 + flo(shr), gs2, gs - flo(shr.times(2)), outline, ["u", "d"]);
        }
        if(txv == 1) { // right
          semiCirc(x2 + flo(shr), y2, flo(rad), "l", outline);
          rect(x1 + flo(shr.plus(10)), y1 + flo(shr), gs2, gs - flo(shr.times(2)), outline, ["u", "d"]);
        }
      }
      function showTrailC(id) {
        let tile = trail[id];
        let size = dec(tween(1, 0.8, tail, 2, 2)[trail.length - id - 1]);
        let shr = dec(1).minus(size).times(10);

        let x1 = (tile.x + 0.5) * 20;
        let y1 = (tile.y + 0.5) * 20;
        let rad = size.times(10);

      }
      function showTrailT(id) {
        let tile = trail[id];
        let size = dec(tween(1, 0.8, tail, 2, 2)[trail.length - id - 1]);
        let shr = dec(1).minus(size).times(10);
        let sha = color[(trail.length - id) % 2];
        let grad = colToArr(snakeColor(id));
        let col = blendCol(grad, sha, 50);
        col = arrToCol(col);
        let x1 = tile.x * 20;
        let y1 = tile.y * 20;
        let x2 = x1 + 10;
        let y2 = y1 + 10;
        let xv1 = trail[id + 1].x - tile.x;
        let yv1 = trail[id + 1].y - tile.y;
        let xv2 = trail[id - 1].x - tile.x;
        let yv2 = trail[id - 1].y - tile.y;
        let gs2 = gs / 2;
        let rects = {
          "u": {
            "x": x1 + flo(shr),
            "y": y1,
            "w": gs - flo(shr.times(2)),
            "h": gs2,
            "s": ["0", "0", "l", "r"]
          },
          "d": {
            "x": x1 + flo(shr),
            "y": y2,
            "w": gs - flo(shr.times(2)),
            "h": gs2,
            "s": ["0", "0", "l", "r"]
          },
          "l": {
            "x": x1,
            "y": y1 + flo(shr),
            "w": gs2,
            "h": gs - flo(shr.times(2)),
            "s": ["u", "d", "0", "0"]
          },
          "r": {
            "x": x1 + flo(shr.plus(10)),
            "y": y1 + flo(shr),
            "w": gs2,
            "h": gs - flo(shr.times(2)),
            "s": ["u", "d", "0", "0"]
          }
        }
        let p1 = null;
        let p2 = null;
        
        if(yv1 == -1) { // up
          p1 = "u";
        } else if(yv1 == 1) { // down
          p1 = "d";
        } else if(xv1 == -1) { // left
          p1 = "l";
        } else if(xv1 == 1) { // right
          p1 = "r";
        }
        
        if(yv2 == -1) { // up
          p2 = "u";
        } else if(yv2 == 1) { // down
          p2 = "d";
        } else if(xv2 == -1) { // left
          p2 = "l";
        } else if(xv2 == 1) { // right
          p2 = "r";
        }
        
        if(p1 || p2) {
          ctx.fillStyle = col;
          let straight = false;
          if(p1 == "u" && p2 == "d") straight = true;
          if(p1 == "d" && p2 == "u") straight = true;
          if(p1 == "l" && p2 == "r") straight = true;
          if(p1 == "r" && p2 == "l") straight = true;
          let s1 = [...rects[p1].s];
          if(straight == false) {
            s1.splice(s1.indexOf(p2), 1);
          }
          
          rect(
            rects[p1].x, 
            rects[p1].y, 
            rects[p1].w, 
            rects[p1].h,
            outline,
            s1
          );
          let s2 = [...rects[p2].s];
          if(straight == false) {
            s2.splice(s2.indexOf(p1), 1);
          }
          rect(
            rects[p2].x,
            rects[p2].y,
            rects[p2].w,
            rects[p2].h,
            outline,
            s2
          );
        }
      }
      function apple() {

      function showBG() {

        for(var x=0; x<20; x++) {

      function game() {
        if(paused || countdown > 0 || dead) {
          display();
          return;
        }
        
        px += xv;
        py += yv;

        if(px<0) {
          die();
          dead = true;
        }
        if(px>tc-1) {
          die();
          dead = true;
        }
        if(py<0) {
          die();
          dead = true;
        }
        if(py>tc-1) {
          die();
          dead = true;
        }
        
        newTrail = [...trail];

        if(running) {
          newTrail.push({x:px,y:py});
          while(newTrail.length>tail) {
            newTrail.shift();
          }
        }
        
        for(let i = 0; i < newTrail.length - 1; i++) {
          if(running && newTrail[i].x == px && newTrail[i].y == py && !paused && (xv !== 0 || yv !== 0)) {
            die();
            dead = true;
          }
        }
        
        if(!dead) {
          if(running) {
            trail = newTrail;
          }
          pxv = xv;
          pyv = yv;
        }
        
        display();

        if(ax==px && ay==py) {
          sfx.eat();
          tail++;
          ax=Math.floor(Math.random()*tc);
          ay=Math.floor(Math.random()*tc);
          canSpawn = false;
          while(canSpawn === false) {
            canSpawn = true;
            for(var i=0;i<trail.length;i++) {
              rect(trail[i].x*gs,trail[i].y*gs,gs,gs);
              if(trail[i].x==ax && trail[i].y==ay) {
                ax=Math.floor(Math.random()*tc);
                ay=Math.floor(Math.random()*tc);
                canSpawn = false;
              }

        }
        if(getKey(code) == "l" && !dis) {
          left();
        }
        if(getKey(code) == "r" && !dis) {

          pause();

        if(key === "\\") {
